import { Typography,TextField,Checkbox,Grid,LinearProgress, Link, makeStyles, CssBaseline, AppBar, Toolbar, Paper, Stepper, Step, StepLabel, Button } from '@material-ui/core';
import React from 'react';
import theme from '../theme';
import {ThemeProvider} from '@material-ui/core';


interface OtpProps {
    changeState:(newstate:number)=>void;
}

function Copyright() {
    return (
      <Typography variant="body2" color="textSecondary" align="center">
        {'Copyright Â© '}
        <Link color="inherit" href="https://material-ui.com/">
          Your Website
        </Link>{' '}
        {new Date().getFullYear()}
        {'.'}
      </Typography>
    );
  }

  const useStyles = makeStyles((theme) => ({
    appBar: {
      position: 'relative',
      width:'100vw',
      '& label.Mui-focused': {
        color: '#000',
      },
      '& .MuiInput-underline:after': {
        borderBottomColor: '#000',
      },
      '& .MuiOutlinedInput-root': {
        '& fieldset': {
          borderColor: '#000',
        },
        '&:hover fieldset': {
          borderColor: '#000',
        },
        '&.Mui-focused fieldset': {
          borderColor: '#000',
        },
      },
    },
    TextField: {

      width:'2vw'
    },
    layout: {
      width: 'auto',
      marginLeft: theme.spacing(2),
      marginRight: theme.spacing(2),
      [theme.breakpoints.up(600 + theme.spacing(2) * 2)]: {
        width: 600,
        marginLeft: 'auto',
        marginRight: 'auto',
      },
    },
    paper: {
      marginTop: theme.spacing(3),
      marginBottom: theme.spacing(3),
      padding: theme.spacing(2),
      [theme.breakpoints.up(600 + theme.spacing(3) * 2)]: {
        marginTop: theme.spacing(6),
        marginBottom: theme.spacing(6),
        padding: theme.spacing(3),
        width:'50vw',
        height:'30vw',
        marginLeft: 'auto',
        marginRight: 'auto',

      },
    },
    stepper: {
      padding: theme.spacing(3, 0, 5),
    },
    buttons: {
      display: 'flex',
      justifyContent: 'flex-end',
    },
    button: {
      marginTop: theme.spacing(3),
      marginLeft: theme.spacing(1),
      width:'5vw',
    },
  }));



const Otp: React.FC<OtpProps> = ({changeState }: OtpProps) => {
    const classes = useStyles();

    return(
      <ThemeProvider theme={theme}>
        <React.Fragment >
      <CssBaseline />
      <AppBar position="absolute" color="default" className={classes.appBar}>
        <Toolbar>
        <Grid container justify="flex-end" style={{ padding: 0 }}>
        <Button
              type="submit"
              variant="outlined"
              style={{backgroundColor: '#fff', color: '#000'}}
              onClick={()=>changeState(2)}
            >
              Sign Out
            </Button>
        </Grid>

        </Toolbar>
      </AppBar>

        <Paper className={classes.paper}>
        <Typography variant="h6" color="inherit" noWrap>
            Enter your OTP
          </Typography>
          An OTP has been sent to name@gmail.com
          <br></br>
          Please verify your account before continuing
          <br></br>
          <div style={{ display: 'inline-flex' }}>
            <div>
            <TextField style = {{width: 60}} id="outlined-basic"  variant="outlined" />            </div>
            <div style={{ alignSelf: 'center' }}>
            <TextField style = {{width: 60}} id="outlined-basic"  variant="outlined" />            </div>
            <div>
            <TextField style = {{width: 60}} id="outlined-basic"  variant="outlined" />            </div>
            <div style={{ alignSelf: 'center' }}>
            <TextField style = {{width: 60}} id="outlined-basic"  variant="outlined" />            </div>
        </div>
          <React.Fragment>

          </React.Fragment>
          <br></br>
          If your inbox is empty please click here
          <br></br>
          Or check your spam box
        </Paper>


    </React.Fragment>
    </ThemeProvider>

    );
}


export default Otp;
